import React from "react";
import styled from "styled-components";
const Wrapper = styled.div`
  width: 100%;
  height: 60px;
  border-radius: 10px;
  border: solid 1px #dbdbdb;
  margin-top: 10px;
`;
function Agree() {
  return (
    <Wrapper>
      <div className="left">
        <button></button>
        <span>개인정보 수집 및 이용에 동의합니다</span>
      </div>
      <div className="right">내용보기</div>
    </Wrapper>
  );
}

export default Agree;
